import React from "react";

import '../Css/MensajeSeguChat.css';

function MensajeSeguChat({texto}){
  return(
    <div className="ContenedorMsgChat2">
      <label className="MensajeSegundoChat">{texto}</label>
    </div>
  )
};

export default MensajeSeguChat;
